import React from "react";

//props.Fav = {fav}
function Food({ name, picture }) {
  return (
    <div>
      <h3>I like {name}</h3>
      <img src={picture}></img>
    </div>
  );
}

const FoodIlike = [
  {
    name: "kimchi",
    image:
      "data:image/jpeg;base64,"
  },
  {
    name: "hamburger",
    image:
      "data:image/jpeg;base64,"
  },
  {
    name: "pizza",
    image:
      "data:image/jpeg;base64,"
  }
];

function App() {
  return (
    <div>
      {FoodIlike.map(current => console.log(current))}
      {FoodIlike.map(current => (
        <Food name={current.name} picture={current.image}></Food>
      ))}
      {/* FoodIlike의 name과 image 각각 props로 넘겨줘도 되지만 object로 하나의 props로 넘겨서 사용하는것도 가능! */}
      {/* {FoodIlike.map(current => (
        <Food Info={current}></Food>
      ))} */}
    </div>
  );
}

export default App;
